    const context = useContext(RoomContext);
    //console.log(context);
    const {
        handleChange, 
        type, 
        capactiy, 
        price, 
        minPrice, 
        maxPrice, 
        minSize, 
        maxSize,
        breakfast, 
        pets
    } = context;
    return (
        <section className="filter-container">
            <Title title="search Houses" />
        </section>
    )
}
